import Link from 'next/link';
import Layout from '../components/Layout';
import Sampledata from '../components/Sampledata';


const h1 = {
    fontSize: '72pt',
    fontWeight: 'bold',
    textAlign: 'right',
    letterSpacing: '-8px',
    color: '#f0f0f0',
    margin: '-40px 0px'
}


const p = {
    margin: '0px',
    color: '#666',
    fontSize: '16pt'
}


export default () => (
    <Layout header="Fire" title="Sample data.">
        <Sampledata />
    </Layout>
);
